import {BrowserRouter as Router, Routes, Route} from "react-router-dom";

const App = () => {
    return (
        <Router>
            <nav></nav>
            <Routes>
                <Route to="/" element={<h1>Home</h1>}/>
                <Route to="/institutions" element={<h1>Institutions</h1>}/>
            </Routes>
        </Router>
    )
}

export default App;
